import React, { Component } from "react";
import ServiceList from "./ServiceList";

export default class Home extends Component {
  render() {
    return (
      <div>
        <div className="container border">
          {/* header */}
          <div className="bg-dark" height="100">
            <img
              src="https://drive.google.com/thumbnail?id=1xLmzOi2bUU3P-shxKZ8o5XF0VI9vxbzW&sz=w1000"
              alt="Book My Clean"
            />
          </div>
        </div>
        <ServiceList />
        <div className="container border" style={{ height: "1000px" }}></div>
      </div>
    );
  }
}
